Config.html.body:
配置
通过命令easyApi -h可以查看命令行支持的相关指令。
Usage: easyApi [options]

Options:
  -V, --version              output the version number
  -i, --input          input file or directory, must be specified
  -o, --output         output api doc file directory, default will create a "api_doc" folder in current working directory
  -c, --config         the config.js file, default will look for "easy.config.js" in current working directory
  -s, --server [serveraddr]  static server host, default will use "localhost"
  -p, --port           static server port, default will use 9527
  -h, --help                 output usage information

默认easyApi会读取当前目录下的easy.config.js文件(若存在的话)，当做配置，若同时提供命令行参数，命令行参数会覆盖easy.config.js里面相同参数配置。
# easy.config.js
const config = {
  "version": "",  // api对应的版本 默认为1.0.0
  "title": "", // 文档的title 默认为easyApi
  "input": "", // 生成文档的源文件所在目录
  "output": "", // 生成文档文件所在的目录，默认为api_doc
  "baseUrl": "", // api请求示例时，增加的统一前缀
  "server": "localhost", // 本地服务的host,默认为localhost
  "port": 9527, // 本地服务的端口,默认为9527
  // "proxy": { // api请求的代理配置
  //   "/api": {
  //     "target": "http://localhost:5000",
  //     "changeOrigin": true
  //   }
  // }
}

module.exports = config;

params/@Api.html.body:
@Api
用来指定请求方法和请求路径，用法：@Api 请求方法 请求路径。
示例：
/**
 * @Api get /api/getTest
 */

params/@Version.html.body:
@Version
表示当前api的版本，用法：@Version 1.0.0。不设置此字段，默认api版本为1.0.0。
示例：
/**
 * @Version 1.0.0
 */

params/@Group.html.body:
@Group
用来标识当前api所属的群组，用法：@Group 组名称，不设置此字段，默认群组为default。相同组名称的api将组织在一起。
示例：
/**
 * @Group demo
 */
